sections.code:
#main-wrap, body {
    background-color: #060606;
    background: #060606;
}

.lobby__app__content, .lobby__box__top, .lobby__box__content tr, rm6, rm6 > .buttons, .round__app__table, .game__meta, i5z, .fbt, .analyse__tools, .ceval, index, .result, .status, .time {
    background: #060606 !important;
}

.round__app {
    margin-top: 150px;
}

.explorer-box tr:nth-child(2n), .tview2-column > interrupt, .pv_box {
    background: #111;
}

body.zen rm6, body.zen .rcontrols, body.zen .bar, body.zen .material {
    display: none;
}

body.zen .rclock {
    font-size: 0.75em !important;
    display: block;
    grid-area: unset;
    margin-left: -6px;
    position: fixed;
    left: 50%;
    transform: translateX(-50%);
    opacity: 0.2;
}

body.zen .rclock.running {
    opacity: 1;
}

body.zen .round__app {
    position: relative;
}

body.zen .rclock-bottom {
    bottom: 20px;
}

body.zen .rclock-top {
    top: 20px;
}

.lobby__app__content .active, #zentog {
    background: #000 !important;
}

#zentog {
    opacity: 0;
}

.lobby__app__content > div {
    border-radius: 0;
}

.lobby__app__content > div:hover {
    background-color: transparent;
}

.tabs-horiz, .lobby__tv, .lobby__puzzle, .lobby__tournaments, .lobby__support, .lobby__about, .lobby__blog, #friend_box, .lobby__side, .mchat {
    display: none;
}

#modal-wrap, .time-mode-config, .ratings, .level label {
    background: #111 !important;
    border: 0 !important;
}

.follow-up {
    border: 0 !important;
}

.level label, select {
    background: #000 !important;
    border: 0 !important;
}

* {
    box-shadow: none !important;
}

.button.button-metal {
   background: #000;
   border: 1px solid #aaa;
    border-radius: 0;
}

.button.button-metal:hover {
    background: transparent !important;
}
